import classes from './Card.module.css';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Card = ({ card }) => {
    return (
        <div className='card mx-auto mb-2 rounded-5'>
            <img class="card-img-start img-fluid" src="https://uploads-ssl.webflow.com/60812e315b9a3608a16845ef/64cbb8558ddf5fcc8f95a488_Card%201%20%20-%20Image.png" alt="Card image cap" style={{width: '20%', height: '20%'}}></img>
            <h2>{card.card_title}</h2> 
            {card.data && <p>{card.data_type}: {card.data_value} </p> } 
            {card.button && <button className='btn btn-primary'>{card.button_name}</button>}
            {card.link && <a href={card.redirect}>{card.link_name}</a>}
            {card.note && <p>{card.note}</p>}
        </div>
    );
  };

  export default Card;
